import AdminNavbar from "../components/AdminNavbar";
import { Link } from "react-router-dom";



function AdminLayout({ children }) {
  return (
    <>
      <AdminNavbar />

      {/* Admin Menu */}
      <div className="bg-dark px-4 py-2">
        <Link className="text-white me-3" to="/admin/dashboard">Dashboard</Link>
        <Link className="text-white me-3" to="/admin/products">Products</Link>
        <Link className="text-white" to="/admin/users">Users</Link>
      </div>

      <div className="container my-4">
        {children}
      </div>
      <div style={{ display: "flex" }}>
      <AdminNavbar />

      <div style={{ marginLeft: "260px", width: "100%", padding: "20px" }}>
        {children}
      </div>
    </div>
    </>
  );
}

export default AdminLayout;
